CREATE TABLE IF NOT EXISTS `BACKUP` (
  `backup_id` int(11) NOT NULL AUTO_INCREMENT,
  `backup_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `backup_mailed` int(11) NOT NULL DEFAULT '0',
  `backup_done` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`backup_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `FINE` (
  `fine_id` int(11) NOT NULL AUTO_INCREMENT,
  `l_id` int(11) NOT NULL,
  `fine_amount` float NOT NULL,
  `fine_date` date NOT NULL,
  PRIMARY KEY (`fine_id`),
  KEY `people_fine_fk` (`l_id`),
  CONSTRAINT `people_fine_fk` FOREIGN KEY (`l_id`) REFERENCES `LOANS` (`loan_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=100 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `FINE_HIS` (
  `fine_id` int(11) NOT NULL DEFAULT '0',
  `l_id` int(11) NOT NULL,
  `fine_amount` float NOT NULL,
  `fine_date` date NOT NULL,
  `modified_date` date NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `FINE_RANGE` (
  `range_id` int(11) NOT NULL AUTO_INCREMENT,
  `min` double DEFAULT NULL,
  `max` double DEFAULT NULL,
  `fine_amt` int(11) NOT NULL,
  `isActive` tinyint(1) NOT NULL,
  PRIMARY KEY (`range_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `INSTALLMENTS` (
  `installment_id` int(11) NOT NULL AUTO_INCREMENT,
  `loan_id` int(11) NOT NULL,
  `installment_amount` double NOT NULL,
  `installment_deposit_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `depositByID` int(11) NOT NULL,
  `note` text NOT NULL,
  `installment_type` int(11) NOT NULL,
  PRIMARY KEY (`installment_id`),
  KEY `fk_loan_installment` (`loan_id`),
  KEY `fk_type_installment` (`installment_type`),
  CONSTRAINT `fk_loan_installment` FOREIGN KEY (`loan_id`) REFERENCES `LOANS` (`loan_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_type_installment` FOREIGN KEY (`installment_type`) REFERENCES `L_INSTALLMENT_TYPE` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=12039 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `INSTALLMENTS_HIS` (
  `installment_id` int(11) NOT NULL DEFAULT '0',
  `loan_id` int(11) NOT NULL,
  `installment_amount` double NOT NULL,
  `installment_deposit_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `depositByID` int(11) NOT NULL,
  `note` text NOT NULL,
  `installment_type` int(11) NOT NULL,
  `modified_date` date DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `LOANS` (
  `loan_id` int(11) NOT NULL AUTO_INCREMENT,
  `loan_type_id` int(11) NOT NULL,
  `loan_amount` double NOT NULL,
  `due_date` text,
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `loan_cycle_id` int(11) NOT NULL,
  `fine_isActive` int(11) DEFAULT NULL,
  `isActive` int(11) NOT NULL,
  `interst_rate` float NOT NULL,
  `installment_amt` double NOT NULL,
  `loaned_byID` int(11) NOT NULL,
  `person_id` int(11) NOT NULL,
  `installment_number` int(11) NOT NULL,
  `file_charge` double NOT NULL DEFAULT '0',
  PRIMARY KEY (`loan_id`),
  KEY `fk_loan_type` (`loan_type_id`),
  KEY `fk_loan_cycle` (`loan_cycle_id`),
  KEY `fk_loan_people` (`person_id`),
  CONSTRAINT `fk_loan_cycle` FOREIGN KEY (`loan_cycle_id`) REFERENCES `L_LOAN_CYCLE` (`l_cycle_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_loan_people` FOREIGN KEY (`person_id`) REFERENCES `PEOPLE` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_loan_type` FOREIGN KEY (`loan_type_id`) REFERENCES `L_LOAN_TYPE` (`l_type_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=50 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `LOANS_HIS` (
  `loan_id` int(11) NOT NULL DEFAULT '0',
  `loan_type_id` int(11) NOT NULL,
  `loan_amount` double NOT NULL,
  `due_date` text,
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `loan_cycle_id` int(11) NOT NULL,
  `fine_isActive` int(11) DEFAULT NULL,
  `isActive` int(11) NOT NULL,
  `interst_rate` float NOT NULL,
  `installment_amt` double NOT NULL,
  `loaned_byID` int(11) NOT NULL,
  `person_id` int(11) NOT NULL,
  `installment_number` int(11) NOT NULL,
  `file_charge` double NOT NULL DEFAULT '0',
  `modified_date` date DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `LOGIN_SESSION` (
  `session_id` int(11) NOT NULL AUTO_INCREMENT,
  `token` text NOT NULL,
  `start_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `user_id` int(11) NOT NULL,
  PRIMARY KEY (`session_id`),
  KEY `fk_user_session` (`user_id`),
  CONSTRAINT `fk_user_session` FOREIGN KEY (`user_id`) REFERENCES `USERS` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=150 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `LOGIN_SESSION_HIS` (
  `session_id` int(11) NOT NULL DEFAULT '0',
  `token` text NOT NULL,
  `start_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `user_id` int(11) NOT NULL,
  `end_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `L_Active` (
  `active_id` int(11) NOT NULL,
  `a_text` varchar(20) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `L_FINE_RATES` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fine_amount` int(11) NOT NULL,
  `isActive` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `L_INSTALLMENT_TYPE` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `L_LOAN_CYCLE` (
  `l_cycle_id` int(11) NOT NULL AUTO_INCREMENT,
  `cycle` int(11) NOT NULL,
  `name` varchar(50) NOT NULL,
  PRIMARY KEY (`l_cycle_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `L_LOAN_TYPE` (
  `l_type_id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(50) NOT NULL,
  PRIMARY KEY (`l_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `PEOPLE` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  `address` text NOT NULL,
  `loan_type_id` int(11) NOT NULL,
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `mob` text NOT NULL,
  `isActive` int(11) NOT NULL,
  `description` text NOT NULL,
  `photo_url` text,
  `father_name` varchar(100) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_people_type` (`loan_type_id`),
  CONSTRAINT `fk_people_type` FOREIGN KEY (`loan_type_id`) REFERENCES `L_LOAN_TYPE` (`l_type_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=9217097 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `PEOPLE_HIS` (
  `id` int(11) NOT NULL DEFAULT '0',
  `name` varchar(50) NOT NULL,
  `address` text NOT NULL,
  `loan_type_id` int(11) NOT NULL,
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `mob` text NOT NULL,
  `isActive` int(11) NOT NULL,
  `description` text NOT NULL,
  `photo_url` text
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `SUPER_USER` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_super_user_user` (`uid`),
  CONSTRAINT `fk_super_user_user` FOREIGN KEY (`uid`) REFERENCES `USERS` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `USERS` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `role` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;



















